import React from "react";
import CodingPage from "../CodingPage/CodingPage";
import ContactPage from "../ContactPage/ContactPage";
import ComicsPage from "../ComicsPage/ComicsPage";

const LandingPage = () => {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100 text-gray-900 p-6">
      {/* Hero Section */}
      <div className="text-center mb-10">
        <h1 className="text-4xl font-bold">welcome to mattstyles.com</h1>
        <p className="text-lg text-gray-600">[Your Title or Tagline]</p>
        <img src="../images/prof-photo.png" alt="Profile" className="w-32 h-32 rounded-full mt-4 shadow-lg" />
      </div>

      {/* About Section */}
      <div className="max-w-2xl text-center mb-10">
        <h2 className="text-2xl font-semibold mb-3">About Me</h2>
        <p className="text-gray-700">
          [Write a short, engaging bio about yourself. Mention your background, interests, and passions.]
        </p>
      </div>

      {/* Skills Section */}
      <div className="max-w-2xl text-center mb-10">
        <h2 className="text-2xl font-semibold mb-3">Skills</h2>
        <p className="text-gray-700">React | JavaScript | Node.js | MySQL | CSS | [Other Skills]</p>
      </div>

      {/* Coding Section */}
      <CodingPage/>

      {/* Comics Section */}
      <ComicsPage/>

      {/* Contact Section */}
      <ContactPage/>
    </div>
  );
};

export default LandingPage;
